VALUES ('3256220064491', 'Crème glacée 3 chocolats', 'crème glacée chocolat noir 40,8%: lait écrémé reconstitué, crème (dont stabilisant : carraghénanes), eau, sucre, cacao maigre en poudre 6,2%*, lactose et protéines de lait , sirop de glucose de maïs, dextrose de maïs, chocolat noir 1%* (sucre, pâte de cacao, beurre de cacao, emulsifiant : lécithine de soja), émulsifiant : mono- et diglycérides d\'acide gras, stabilisants : gomme guar - alginate de sodium. * pourcentage exprimé sur la crème glacée chocolat crème glacée chocolat blanc 40,8%: lait écrémé reconstitué, crème, eau, sucre, chocolat blanc 8%* (sucre, beurre de cacao, lactosérum en poudre, matière grasse laitière anhydre, lait écrémé en poudre, émulsifiant : lécithine de soja, arôme naturel de vanille), lactose et protéines de lait, sirop de glucose, émulsifiant : mono- et diglycérides d\'acide gras, stabilisants : farine de graine de caroube - gomme guar - carraghénanes. *pourcentage exprimé sur la crème glacée chocolat blanc.Sauce au cacao 16,4%: sucre, sirop de glucose-fructose de maïs, eau, lait concentré sucré, cacao maigre en poudre 5%*, amidon de tapioca, épaississant : gomme xanthane, arôme naturel, sel.***pourcentage exprimé sur la sauce au cacao.copeaux de chocolat au lait et de chocolat blanc 2%: sucre, lait entier en poudre, beurre de cacao, pâte de cacao, lait écrémé en poudre, arôme naturel de vanille, émulsifiant : lécithine de soja Traces éventuelles de gluten, d\'oeuf et de fruits à coques', 'https://static.openfoodfacts.org/images/products/325/622/006/4491/front_fr.21.400.jpg', '5.4', '2.5', '16', '12.8', '0.5', '1.9', '0.05', '0.0196850393700787', '', '0');

