VALUES ('3256220064507', 'Crème glacée vanille, noix de pécan et caramel', 'Crème glacée vanille 78% : lait écrémé reconstitué, crème, eau, sucre, lactose et protéines de lait, sirop de glucose de maïs, émulsifiant : mono- et diglycérides d\'acide gras, stabilisants : farine de graine de caroube - gomme guar - carraghénanes, arômes naturels de vanille, gousses de vanille épuisées broyées 0.1%*, colorant : bêta-carotène.*pourcentage exprimé sur la crème glacée vanilleSauce au caramel et beurre salé 16% : eau, sirop de glucose de maïs, sucre, lait concentré sucré, beurre salé 6,8%*, stabilisants : amidon modifié de maïs, sucre caramélisé, émulsifiant : mono- et diglycérides d\'acide gras, correcteur d\'acidité : acide lactique, épaississant : gomme xanthane, arômes naturels. *pourcentage exprimé sur la sauce au caramel et beurre salé.Morceaux de noix de pécan caramélisés 6% : noix de pécan 70%*, sucre. *pourcentage exprimé sur les morceaux de noix de pécan caramélisés en inclusions et en décor.Traces éventuelles de gluten, \'ufs et autres fruits à coque.', 'https://static.openfoodfacts.org/images/products/325/622/006/4507/front_fr.30.400.jpg', '11', '5', '30', '24', '0.6', '2.5', '0.11', '0.0433070866141732', '', '1');

