VALUES ('3256220067034', 'Coffret snacks et sauce ketchup', 'Sauce ketchup : Tomate (min 135g pour élaborer 100 g de ketchup), sirop de glucose-fructose, sucre, vinaigre d\'alcool, sel, amidon modifié de maïs, arôme, conservateur : sorbate de potassium. Soufflés goût bacon : Pomme de terre déshydratée (contient des SULFITES), semoule de maïs (France), farine de BLÉ, huile de tournesol 14%, arôme et arôme de fumée (contient du LAIT), sel, chlorure de potassium, colorant : extrait de paprika. Soufflés goût salé : Pomme de terre déshydratée (contient des SULFITES), semoule de maïs (France), huile de tournesol 10%, arôme (contient du BLÉ), sel, exhausteurs de goût : glutamate monosodique - guanylate disodique - inosinate disodique, colorant : curcumine. Soufflés goût oignon : Semoule de maïs (France), huile de tournesol 21%, farine de BLÉ, poudre d\'oignon 6%, son de BLÉ, poudre de LAIT écrémé, assaisonnement goût oignon (oignon, arômes naturels, sel, LACTOSERUM en poudre, sucre), sel, persil, colorant : curcumine. Soufflés goût pizza : Pomme de terre déshydratée 41% (contient des SULFITES), amidon de pomme de terre (contient des SULFITES), huile de tournesol 19.5%, assaisonnement aromatisé (farine de BLÉ, poudre de LACTOSERUM, tomate en poudre, sel, sucre, exhausteur de goût : glutamate monosodique, arôme naturel, oignon en poudre, plantes aromatiques (origan et persil), acidifiant : acide citrique, extrait de paprika, arôme, extrait de plantes aromatiques), sel, paprika, extrait de curcuma. Traces éventuelles d\'arachide et crustacés.', 'https://static.openfoodfacts.org/images/products/325/622/006/7034/front_fr.26.400.jpg', '15', '1.2', '66', '2.4', '5.1', '7.5', '1.5', '0.590551181102362', '', '0');

