INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256220171366', 'Glace façon rocher praliné', 'Crème glacée chocolat 40% : LAITécrémé reconstitué, CREME, eau, sucre, LACTOSE et protéines de LAIT, cacao maigre en poudre, sirop de glucose, dextrose, chocolat noir 2%* (sucre, pâte de cacao, beurre de cacao, émulsifiant : lécithine de SOAJ), émulsifiant : mono- et diglycérides d\'acide gras, stabilisants : gomme guar - alginate de sodium.*Pourcentage exprimé sur la crème glacée chocolat.Crème glacée noisette 39,4% : LAIT écrémé reconstitué, CREME, eau, sucre, LACTOSE et protéines de LAIT, sirop de glucose, pâte de NOISETTE 3%*, cacao maigre en poudre, émulsifiant : mono- et diglycérides d\'acide gras, stabilisants : farine de graine de caroube - gomme guar - carraghénanes, arôme naturel.*Pourcentage exprimé sur la crème glacée noisette.Sauce saveur praliné 16,2% : eau, sucre, sirop de glucose-fructose, LAIT concentré sucré, pâte de NOISETTE 4%*, amidon de tapioca, cacao maigre en poudre 2%*, épaississants : pectine gomme xanthane, émulsifiant : mono- et diglycérides d\'acide gras, arôme naturel, sel.*Pourcentage exprimé sur la sauce saveur praliné.Noisettes au sucre 4,4% : NOISETTE 50%*, sucre.*Pourcentage exprimé sur les noisettes au sucre.Traces éventuelles d\'uf, de gluten et d\'autres fruits à coque.', 'https://static.openfoodfacts.org/images/products/325/622/017/1366/front_fr.42.400.jpg', '9.8', '4.7', '28', '22', '1', '3.5', '0.11', '0.0433070866141732', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256220171397', 'Vacherin glacé vanille framboise', 'Crème glacée vanille 41,9% : eau, LAIT écrémé réhydraté (France), CREME (France), sirop de glucose-fructose, sucre, LACTOSE et protéines de LAIT, sirop de glucose, arôme naturel de vanille, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar, colorants : rocou - curcumine.Sorbet framboise 41,7% : Purée de framboise 50%*, eau, sucre, sirop de glucose-fructose, sirop de glucose, jus concentré de sureau, gélifiants : pectines - gomme xanthane - gomme tara, dextrose, colorant : rouge de betterave, protéines de pois hydrolysées (protéines de pois, sucre) , arôme naturel de framboise, acidifiant : acide citrique. (*Pourcentage exprimé sur le sorbet framboise).Meringue 11,9% : sucre, blanc d\'OEUF.Préparation de morceaux de framboise 3,4% : Morceaux de framboise 58%*, sucre, sirop de glucose-fructose, eau, épaississant : amidon transformé de maïs, gélifiants : gomme xanthane - carraghénanes , arôme naturel, correcteur d\'acidité : citrates de potassium, jus concentré de fruits rouges. (*Pourcentage exprimé sur la préparation de morceaux de framboise).Pépites à la framboise 1,1% : Purée de framboise 32%*, sucre, pomme, dextrose, fibres d\'ananas, colorant : anthocyanes, épaississants : alginate de sodium - phosphates de calcium, arôme, correcteur d\'acidité : acide citrique. (*Pourcentage exprimé sur les pépites à la framboise). Traces éventuelles de gluten, arachide, soja et fruits à coque.', 'https://static.openfoodfacts.org/images/products/325/622/017/1397/front_fr.25.400.jpg', '3.8', '2.5', '34.7', '29.9', '0.8', '1.5', '0.1', '0.0393700787401575', '', '0');

