ïdes, gélifiants : farine de graine de caroube - gomme guar, acidifiant : acide citrique, arôme naturel, antimoussant : mono- et diglycérides d\'acides gras. *(Pourcentage exprimé sur l\'enrobage aux fruits exotiques). Traces éventuelles de gluten, oeuf, arachide, soja et fruits à coque.', 'https://static.openfoodfacts.org/images/products/325/622/017/1403/front_fr.7.400.jpg', '5.4', '4.7', '26', '21', '0.5', '1.2', '0.08', '0.031496062992126', '', '1');

