INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256220213301', 'Barre de céréales abricot amande aux 4 céréales', 'Céréales 32% {ﬂocons d\'_avoine_ 20%, céréales extrudées [farine de riz 5%, farine de _blé_ 4%, sucre, farine d\'_orge_ maltée 0,1%, farine de _blé_ maltée 0,1%, émulsifiant : lécithines de _soja_, huile de colza, antiagglomérant : carbonate de calcium], pétales de mais (maïs 2%, sucre, sel, extrait de malt d\'_orge_, émulsifiant : mono- et diglycérides d\'acides gras)}, sirop de glucose, abricots secs 7,7% (abricots, farine de riz, antioxydant : anhydride sulfureux (_sulﬁtes_)), dextrose, graisses végétales (palmiste, stéarine de palme), graisse de palme, sucre, _lait_ écrémé concentré sucré (_lait_ écrémé, sucre), sucre glace, _amandes_ 2,6%, préparation laitière caramélisée en poudre [_lactosérum_, _beurre_, maltodextrine, sucre, _lait_ écrémé], humectant : glycérol, émulsifiant : lécithines de _soja_, matière grasse _laitière_ anhydre, arômes, sel, mélasse.', 'https://static.openfoodfacts.org/images/products/325/622/021/3301/front_fr.6.400.jpg', '15.5', '7.7', '66', '30', '3', '4.9', '0.1', '0.0393700787401575', '', '0');

