INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256220258531', 'Blanquette de la mer', 'Sauce à la crème fraîche 40% : eau, CREME fraîche (France) 3%, échalote 1%, vermouth, farine de BLE, LAIT entier en poudre, fumet de poisson aromatisé [maltodextrine, sel, farine de BLE, POISSON en poudre, sucre, légumes (oignon, poireau, CELERI), CREME en poudre, extrait de levure, huile d\'olive, arôme naturel (contient CRUSTACES et POISSONS), LACTOSE, poudre et extrait de CREVETTE, épices et aromates, extrait de vin blanc, graine de CELERI], BEURRE, arôme naturel (contient MOLLUSQUES), huile d\'olive vierge extra, amidon transformé de maïs, sel, persil 0.1%, ail, algue déshydratée, curcuma. Légumes 33.6% : courgette 16.7%, carotte orange 8.9%, carotte jaune 8%. Poissons et moule du Pacifique décoquillée cuite 26.4% : COLIN d\'Alaska (Theragra chalcogramma, pêché en Pacifique nord-est ou nord-ouest) 14.2%, SAUMON (Salmo salar, élevé au Chli ou en Norvège) 6.2%, MOULE du Pacifique décoquillée cuite (Mytilus chilensis, élevée au Chili) 6%.', 'https://static.openfoodfacts.org/images/products/325/622/025/8531/front_fr.46.400.jpg', '3.5', '1.7', '2.9', '1.5', '0.9', '6.5', '0.45', '0.177165354330709', '', '1');

