VALUES ('3256220357807', 'Glace à la noix de coco', 'Glace à la noix de coco 93.9% : eau, LAIT écrémé reconstitué, sucre, l, ait de coco en poudre 9%* (lait de coco, maltodextrine, caséinates de, sodium), LACTOSE et protéines de LAIT, dextrose, émulsifiant : mono- e, t diglycérides d\'acide gras, stabilisants : farine de graine de caroub, e - gomme guar - alginate de sodium, arôme naturel. * pourcentage expr, imé sur la glace à la noix de coco. Noix de coco râpée 6.1% : noix de, coco 51%*, sucre, eau, humectant : glycérine, sel.* pourcentage expri, mé sur la noix de coco râpée. Traces éventuelles d\'oeuf et de fruits à, coques', 'https://static.openfoodfacts.org/images/products/325/622/035/7807/front_fr.60.400.jpg', '7.8', '6.7', '27', '25', '0.3', '2.4', '0.09', '0.0354330708661417', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256220358026', 'Paëlla aux fruits de mer, aiguillettes de poulet, colin d\'Alaska et chorizo', 'Riz cuit au curcuma 47% (eau, riz, curcuma), eau, morceau de filet de poulet traité en salaison rôti 7% [filet de poulet (origine : Pologne) 5%, eau, amidon de tapioca, dextrose, sel], COLIN d\'Alaska (Theragra chalcogramma, pêché en Pacifique nord-est ou nord-ouest) 5%, petit pois 4%, anneau de CALMAR (Loligo chinensis, vulgaris ou duvauceli, pêché en Pacifique centre-ouest ou Océan Indien est ou ouest) 4%, MOULE du Pacifique décoquillée cuite (Mytilus chilensis, élevée au Chili) 4%, crevette décortiquée cuite 4% [CREVETTE (Heterocarpus spp, Parapenaeopsis spp , Penaeus ssp, Solenocera spp, pêchée en Océan Indien est ou ouest) 3%, eau, sel], poivron rouge préfrit 3% (poivron, huile de tournesol), chorizo 2% [viande et gras de porc (origine : France), piment doux, LACTOSE, sel, dextrose, épices, antioxydant : ascorbate de sodium, ferments], poivron vert 2%, oignon, poivron jaune 1%, huile de tournesol, purée de tomate double concentrée, arômes naturels (contient CRUSTACES et LAIT), ail 0, 4%, huile d\'olive vierge extra 0, 4%, oignon en poudre, sel, assaisonnement (sel, amidon de pomme de terre, épices, sucre, extrait d\'épice, oignon), paprika, amidon de maïs, curcuma 0, 01%, poivre. Soit 72% de riz cuit cuisiné dans le produit.', 'https://static.openfoodfacts.org/images/products/325/622/035/8026/front_fr.38.400.jpg', '3.2', '0.64', '15.8', '0.2', '0.9', '7.1', '0.7', '0.275590551181102', '', '1');

