VALUES ('3256220368995', 'Cocktail de fruits de mer', 'MOULES du Pacifique décoquillées cuites 35% [Mytilus chilensis, élevées au Chili], têtes et pattes de CALMARS blanchis 25% [CALMARS (Loligo duvauceli, pêchés au chalut en océan Indien Ouest (A*) ou Loligo edulis ou Loligo chinensis, pêchés au chalut en océan Pacifique Nord Ouest ou Centre Ouest (B*)), eau, sel, correcteur d\'acidité: citrates de sodium], queues de CREVETTES décortiquées blanchies 25% [CREVETTES (Metapenaeus monoceros ou Metapenaeus affinis ou Metapenaeus dobsoni, pêchées au chalut en océan Indien Ouest), eau, sel], NOIX DE ST-JACQUES 15% [Zygochlamys patagonica, pêchées au chalut en océan Atlantique Sud Ouest, origine Argentine (C*) ou Chlamys opercularis, pêchées au chalut en océan Atlantique Nord Est- Manche ou Mer d\'Irlande ou Ouest Ecosse (origine France (D*) ou Royaume-Uni (E*) ou Irlande (G*))].*Pour connaître l\'origine des fruits de mer, voir les lettres sous le numéro de lot. Traces éventuelles de poisson et sulfites.', 'https://static.openfoodfacts.org/images/products/325/622/036/8995/front_fr.38.400.jpg', '1.6', '0.5', '2.3', '0.3', '0.1', '14', '0.65', '0.255905511811024', '', '1');

