VALUES ('3256220470728', 'Feuilleté glacé vanille fruits rouges', 'Glace vanille 51,7% : LAIT écrémé réhydraté (France), eau, matière grasse de palmiste, sucre, sirop de glucose-fructose, LACTOSE et protéines de LAIT, sirop de glucose, émulsifiant : monoglycérides et diglycérides d\'acides gras, gélifiants : farine de graine de caroube - gomme guar - gomme xanthane, arôme naturel de vanille, colorant : caroténoïdes. Sorbet fruits rouges 30,4% : eau, purée de fruits rouges 10,6% (fraise, cassis, framboise, groseille), sirop de glucose-fructose, sucre, jus concentré de sureau, colorant : rouge de betterave, gélifiants : pectines amidées - gomme tara - gomme xanthane, correcteur d\'acidité : acide citrique, protéines de pois hydrolysées, arôme naturel. Pâte de biscuit 8,1% : sucre glace, huile de tournesol, farine de BLÉ (France), BEURRE (France), sucre, poudre de LAIT écrémé, poudre de LACTOSÉRUM, émulsifiant : lécithine de tournesol, arôme naturel de vanille, OEUF en poudre, sel, poudre à lever : diphosphate disodique - carbonate acide de sodium - carbonate d\'ammonium, cannelle. Pâte à glacer au chocolat blanc 4,9% : matière grasse de coprah, sucre, chocolat blanc 0,9% (sucre, beurre de cacao, LAIT écrémé en poudre, matière grasse LAITIÈRE anhydre), LACTOSÉRUM en poudre, émulsifiants : lécithine de SOJA - polyricinoléate de polyglycérol, arôme naturel de vanille. Sauce fruits rouges 2,7% : purée de fruits rouges 1,1%* (purées de fraise, framboise, cassis), sucre, sirop de sucre inverti, jus de cassis à base de concentré 0,1%, eau, gélifiant : pectines, jus concentré de sureau, jus concentré de citron, arômes naturels de cassis, framboise et fraise. Groseilles 1,1%. Myrtilles 1,1%. Traces éventuelles d\'arachide et de fruits à coques.', 'https://static.openfoodfacts.org/images/products/325/622/047/0728/front_fr.21.400.jpg', '11', '7.3', '28', '25', '1', '1.8', '0.11', '0.0433070866141732', '', '1');

