INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256220655514', 'Mini feuilletés à la saucisse', '8 Mini saucisses de Strasbourg feuilletées sauce moutarde : Pâte feuilletée dorée* 50%, saucisse de Strasbourg 32 % (viande de porc (origine : UE), eau, sel, sucre, extrait d\'épices, antioxydant : érythorbate de sodium, colorant : carmins, conservateur : nitrite de sodium), eau, moutarde 5% (eau, graines de MOUTARDE, vinaigre, sel, antioxydant : disulfite de potassium (SULFITES), correcteur d\'acidité : acide citrique), préparation pour béchamel en poudre (LACTOSERUM, amidon transformé de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, épices), amidon transformé de pomme de terre, EMMENTAL, OEUFS en poudre. Saupoudrage 0.5% : graines de pavot. 8 Mini saucisses de Strasbourg feuilletées sauce emmental : Pâte feuilletée dorée* 50%, saucisse de Strasbourg 32% (viande de porc (origine : UE), eau, sel, sucre, extrait d\'épices, antioxydant : érythorbate de sodium, colorant : carmins, conservateur : nitrite de sodium), eau, préparation pour béchamel en poudre (LACTOSERUM, amidon transformé de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, épices), EMMENTAL 1.5%, amidon transformé de pomme de terre, sel, poivre. Saupoudrage 0.5% : mix paprika (épices et extraits d\'épices (dont paprika 0,25%), sel). 8 Mini saucisses de Strasbourg feuilletées sauce barbecue : Pâte feuilletée dorée* 50%, saucisse de Strasbourg 32.% (viande de porc (origine : UE), eau, sel, sucre, extrait d\'épices, antioxydant : érythorbate de sodium, colorant : carmins, conservateur : nitrite de sodium), eau, ketchup (tomates, vinaigre, sucre, sel, extrait d\'épices et de plantes aromatiques (CELERI), épices), purée de tomate mi-réduite, préparation pour béchamel en poudre (LACTOSERUM, amidon transformé de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, épices), double concentré de tomate, arômes (BLE), arôme de fumée, huile de tournesol, amidons transformés de pomme de terre, jus de citron à base de concentré (conservateur : disulfite de sodium), ail, herbes de provence, curry. Saupoudrage 0.5%: persil. *Pâte feuilletée dorée : Farine de blé (farine de BLE, GLUTEN DE BLE), margarine 14,7% (graisse de palme et huile de colza, eau, sel, émulsifiants : mono- et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), eau, sel, LACTOSE, protéines de LAIT, OEUFS en poudre, CREME en poudre. Pourcentages exprimés sur chaque variété d\'apéritif. Traces éventuelles de graines de sésame, poissons, crustacés, mollusques et fruits à coque.', 'https://static.openfoodfacts.org/images/products/325/622/065/5514/front_fr.24.400.jpg', '19', '7.7', '22', '2.6', '1.9', '8.1', '1.3', '0.511811023622047', '', '0');

